message:
"MÉRITO 
01. A PROCEDÊNCIA DOS PEDIDOS para confirmar as preliminares arguidas e para o afastamento dos Ministros Alexandre de Moraes da Presidência do TSE e dele e do Ministro Luís Roberto Barroso dos cargos de Ministro do STF e dos Senadores Davi Alcolumbre e Rodrigo Pacheco da Presidência do Senado e da CCJ, respectivamente, e dos cargos de Senadores e para a prisão deles, seja em flagrante ou preventiva; 
02. A ANULAÇÃO DOS VOTOS COMPUTADOS AO SUPOSTO ELEITO POR SER INELEGÍVEL 28 e a proclamação da eleição do atual Presidente no primeiro turno; 
03. A ANULAÇÃO DE TODOS OS VOTOS OBTIDOS das urnas com numeração idêntica e a proclamação da vitória do atual Presidente no segundo turno, considerando as conclusões do Instituto Voto Legal (IVL), no sentido de que não é possível validar os resultados gerados em todas as urnas eletrônicas de modelos 2009, 2010, 2011, 2013 e 2015, resultados estes que deveriam ser desconsiderados na totalização das eleições no segundo turno; 
04. A ANULAÇÃO DAS ELEIÇÕES DE 2022 PARA TODOS OS CARGOS por quebra do sigilo dos votos e dos eleitores, por infringência do princípio da publicidade no cômputo dos votos, por suspeição do Presidente do TSE e por indícios de formação de organização criminosa para o cometimento de crimes e para derrubar o atual Presidente ilegítima e ilegalmente 29 e para a realização de novas eleições com cédula de papel e contagem pública. Brasília- DF, 05 de dezembro de 2022. "

Sobre o processo contra a moraes e outros, dei uma olhada muito rápida e considerei muito bem embasado. Porém, entendo que o que interessa ao povo são os pedidos. Os pedidos são: 
"PELO EXPOSTO, representa a Vossa Excelência pelo (a) imediato (a): 
PRELIMINARMENTE: 
1. DETERMINAÇÃO PARA QUE SEJA CONSTATADO, no Hospital Sírio Libanês ou onde quer que seja, se o Sr. Luiz Inácio Lula da Silva está vivo ou não e por que há um sósia se apresentando como se fosse ele; 
2. SUSTAÇÃO DE TODO E QUALQUER ATO TENDENTE À DIPLOMAÇÃO DO SUPOSTO ELEITO PRESIDENTE NAS ELEIÇÕES DE 2022, sine die, até que sejam atendidas as exigências as formuladas pelo Ministro da Defesa, pelo Partido Liberal, pela Coligação pelo Bem do Brasil e pelo Presidente Jair Bolsonaro e sejam solucionadas todas as questões relativas à anulação dos votos obtidos por meio das urnas com numeração idêntica (nulidade absoluta) e acessado o código fone;
3. DETERMINAÇÃO AO PRESIDENTE DO TSE PARA A LIBERAÇÃO DO ACESSO AO CÓDIGO FONTE ao Ministro da Defesa, em 24 horas, sob pena de prisão em flagrante; 
4. AFASTAMENTO CAUTELAR dos Senadores David Alcolumbre e Rodrigo Pacheco da Presidência do Senado e da CCJ, respectivamente, e dos cargos de Senadores e dos Ministros Alexandre de Moraes da Presidência do TSE e dele e do Ministro Luís Roberto Barroso dos cargos de Ministro do STF; 
5. DETERMINAÇÃO DAS PRISÕES EM FLAGRANTE dos Senadores David Alcolumbre e Rodrigo Pacheco e dos Ministros Alexandre de Moraes e Luís Roberto Barroso 26; 
6.  DETERMINAÇÃO DAS PRISÕES PREVENTIVAS das referidas autoridades, em razão dos gravíssimos crimes em que estão incursos 27, para a garantia da ordem pública e para assegurar a aplicação da lei penal; 
7.  QUEBRA DOS SIGILOS telefônicos, telemáticos, bancários e fiscais dos Senadores David Alcolumbre e Rodrigo Pacheco e dos Ministros Alexandre de Moraes e Luís Roberto Barroso do STF; 
8. BLOQUEIO DAS CONTAS BANCÁRIAS dos Senadores David Alcolumbre e Rodrigo Pacheco e dos Ministros Alexandre de Moraes e Luís Roberto Barroso; 
9. REQUISIÇÃO DAS EMENDAS RD9 para se constatar a quem foram distribuídos os recursos bilionários a que se refere o Senador Alessandro, de acordo com o vídeo acima juntado; 
10. DETERMINAÇÃO PARA O CONSELHO DE ÉTICA DO SENADO FEDERAL, com base no referido vídeo, de instauração, de ofício, de processo de cassação do mandato do Senador Rodrigo Pacheco, afastando-o imediatamente do cargo, sob pena de ele criar obstáculos para o andamento das investigações e para a obtenção de provas; 
11. APREENSÃO DOS PASSAPORTES DE TODOS OS REPRESENTADOS e a determinação para que a Polícia Federal não permita que eles saiam do País para a garantia da aplicação da Lei Penal; 
12. DETERMINAÇÃO DE DESARQUIVAMENTO e encaminhamento de todos os pedidos de impeachment dos ministros do STF dos últimos 05 anos, ilegalmente paralisados e arquivados para regular tramitação e deliberação do plenário do Senado Federal, com fundamento nos artigos 37 e 52, II, da Constituição Federal, 44 a 49, da Lei 1.079/50 e 377, do Regimento Interno do Senado Federal; 
13. NOTIFICAÇÃO DE TODOS OS SENADORES integrantes do Conselho de Ética e dos Membros da Mesa do Senado Federal para a adoção das medidas legais cabíveis, no sentido de providenciar a tramitação dos mencionados pedidos de impeachment e para apreciar os pedidos de cassação dos mandatos dos Senadores David Alcolumbre e Rodrigo Pacheco, protocolizados no Conselho de Ética do Senado Federal, sob as penas da lei; 
14. Tramitação pública desta representação/NOTITIA CRIMINIS; 
15. Determinação para instauração de inquérito policial e a oitiva do Ministério Público Militar para se manifestar e apurar os crimes, em tese, aqui descritos; 
16. Oitiva imprescindível de testemunhas a serem oportunamente arroladas, por questão de segurança; 
17. Requisição da folha de antecedentes penais, inteiro teor, de todos os processos e inquéritos contra o Sr. Luiz Inácio Lula da Silva. "

Olha pra onde Oswaldo Eustáquio e sua turma, queriam levar os patriotas.
Brasília 08/12
